        "content": "## Holiday City Berkeley Has Two New Board Members"
    },
    {
        "index": 18,
        "tags": [],
        "content": "Joseph Friscia – When Barbara Benson left the board Joseph was appointed to\nthe board. Joseph is a retired Bayonne Police officer of 31 years. He has\nlived in Holiday City at Berkeley for the last 12 years and has been a\nvolunteer for the Veterans and Friends of Veterans Club. Joseph loves music\nand if you are from Hudson County you might have heard him playing in some of\nthe clubs around town. Because of his experience as a police officer Joseph\nwill be handling complaints. He is a very quiet and thoughtful person and will\nbe a great asset to the board and our community."
    },
    {
        "index": 19,
        "tags": [],
        "content": "Mary Paterno-Mihalko – was appointed to the board last September when Henry\nretired from the board. Mary worked for the Army at Fort Monmouth as a\nContracting Office and retired after 30 years.. Mary has lived in HCB for the\npast 2 years and has been active at our meetings. Mary is presently a Realtor\nand brings a different prospective to the Board. Mary will be editing our\ncommunity newspaper, The Bulletin."
    },
    {
        "index": 20,
        "tags": [],
        "content": "We are grateful that both Joseph and Mary have stepped up to take on their\npositions."
