        "content": "## From the President\\'s Desk - October 2021"
    },
    {
        "index": 18,
        "tags": [],
        "content": "The community is approaching the election for the Board of Directors; all\nballots will be sent to each home for your vote."
    },
    {
        "index": 19,
        "tags": [],
        "content": "At today’s shareholders meeting, one of the candidates suggested the election\nmight be compromised and that she did not trust the current Board. I took\nissue with that statement. The election will be supervised by the\nAssociation’s attorney and completed by volunteers from the community. This\ncandidate wanted to outsource not only the mailing, but the entire process. I\nexplained that this would incur an unknown expense."
    },
    {
        "index": 20,
        "tags": [],
        "content": "I then asked for a show of hands for or against this motion and overwhelmingly\nit was shown the shareowners were not in favor of this expense. Only two\nresidents were in favor of spending an unknown amount to outsource the entire\nprocess. I believe that common sense prevailed. Good luck to all candidates."
    },
    {
        "index": 21,
        "tags": [],
        "content": "Please remember: At the October evening meeting each candidate that is running\nfor the Board of Directors will be able to speak for two minutes and answer up\nto two questions from the audience."
    },
    {
        "index": 22,
        "tags": [],
        "content": "Stay safe,"
    },
    {
        "index": 23,
        "tags": [],
        "content": "John"
    },
    {
        "index": 24,
        "tags": [],
        "content": "P.S. Since our meeting, this candidate has apologized for the outburst and\ncomment and so, on behalf of Board as well as myself, I thank her."
