        "content": "Holiday City at Berkeley is an active 55+ community located within Berkeley\nTownship, in Ocean County. Residents, both singles and couples, live\nindependently in single family homes. Here at Holiday City at Berkeley there\nare 2 clubhouses that offer a variety of amenities. Inside our clubhouses,\nresidents can get creative in the ceramics room/arts&crafts room. Homeowners\ncan also challenge friends to a game of cards, ping pong, billiards, relax in\nthe library with a book, or participate in Thursday night bingo. Outdoors, the\nhorseshoe pits, shuffleboard, bocce ball and corn hole are the perfect place\nto have some friendly competition. Each clubhouse features an outdoor pool as\nwell. The Ocean Ride bus service takes residents around the Toms River area\nfor shopping. We have numerous clubs and activities to keep residents socially\nactive or quietly retired. The office, located next to Clubhouse 1, is open\nMonday-Friday from 9am-2pm"
